import React from "react";

const Page = props => {
  let classes = "page-item";
  classes += props.index === props.currentPage ? " active" : "";
  return (
    <li className={classes}>
      <span onPageClicked={props.onPageClicked} className="page-link">
        {props.index}
      </span>
    </li>
  );
};

export default Page;
